import React, { Component } from "react";
import TeamMember from './teammember'
import info from "./memb.info";





class team extends Component {   
   constructor() {
      super()
      this.state = {
         info: { info: info }
         
      }
    let newAry=" "
    this.showPic.this.showPic.bind(this)
   }


   showPic() {
      
      let members = this.state.info.info.map(function (member) {
         return (
            <TeamMember
               id={member.id}
               img={member.img}
               name={member.name}
               email={member.email}
               phone={member.phone} />
                                                  
         )
      })  
      return members
      }
        

   
  


            render(){
              return (
             <div className="row container ">
                    <button onClick={this.showPic} className="btn btn-primary">Click here</button>
                    {this.mapping(this.state.info)}

             </div>
                     )
                     }
}

export default team
